import React from 'react';
import {Route,Switch} from "react-router-dom";
import About from './About';
import Contact from './Contact';
const App = () => {
    return (
        <> 
        <Switch></Switch>
        <About></About>
        <Contact></Contact>
        <h1>tushar</h1>
        </>
    )
};
export default App;
